import { useState } from 'react';
import React from 'react';
import '../Styles/CarManagement.css';

function CarManagement() {
    const [formData, setFormData] = useState({
        kilometers: "",
        releaseDate: "",
        model: "",
        vehicleType: "",
        price: "",
        color: "",
        showroomId: "",
    });
    const [showAddForm, setShowAddForm] = useState(false);

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData((prevData) => ({
            ...prevData,
            [name]: value,
        }));
    };

    const handleSubmit = () => {
        const carData = {
            kilometers: parseInt(formData.kilometers, 10),
            releaseDate: formData.releaseDate,
            model: formData.model,
            vehicleType: formData.vehicleType,
            price: parseInt(formData.price, 10),
            color: formData.color,
        };

        const url = `http://localhost:8080/api/car`;
        const params = `?showroomId=${formData.showroomId}`;

        fetch(url + params, {
            method: "POST",
            headers: {
                "Content-Type": "application/json"
            },
            body: JSON.stringify(carData),
        })
            .then(response => {
                if (!response.ok) {
                    throw new Error("Eroare la trimiterea datelor");
                }
                return response.json();
            })
            .then(() => {
                setFormData({
                    kilometers: "",
                    releaseDate: "",
                    model: "",
                    vehicleType: "",
                    price: "",
                    color: "",
                    showroomId: "",
                });
                setShowAddForm(false);
            })
            .catch(error => console.error("Eroare la trimiterea datelor:", error));
    };

    return (
        <div>
            <h3>Management Mașini</h3>

            {/* Buton pentru afișarea formularului */}
            <div className="button-container">
                <button onClick={() => setShowAddForm(!showAddForm)}>
                    {showAddForm ? "Anulează Adăugarea Mașinii" : "Adaugă Mașină"}
                </button>
            </div>

            {/* Formular pentru adăugarea unei mașini */}
            {showAddForm && (
                <div className="add-form">
                    <h3>Adaugă Mașină Nouă</h3>
                    <label>
                        Kilometri:
                        <input
                            type="number"
                            name="kilometers"
                            value={formData.kilometers}
                            onChange={handleInputChange}
                        />
                    </label>
                    <label>
                        Data Lansării:
                        <input
                            type="text"
                            name="releaseDate"
                            value={formData.releaseDate}
                            onChange={handleInputChange}
                            placeholder="14-11-2014" // adaugă un placeholder pentru a sugera formatul
                        />
                    </label>
                    <label>
                        Model:
                        <input
                            type="text"
                            name="model"
                            value={formData.model}
                            onChange={handleInputChange}
                        />
                    </label>
                    <label>
                        Tip Vehicul:
                        <input
                            type="text"
                            name="vehicleType"
                            value={formData.vehicleType}
                            onChange={handleInputChange}
                        />
                    </label>
                    <label>
                        Preț:
                        <input
                            type="number"
                            name="price"
                            value={formData.price}
                            onChange={handleInputChange}
                        />
                    </label>
                    <label>
                        Culoare:
                        <input
                            type="text"
                            name="color"
                            value={formData.color}
                            onChange={handleInputChange}
                        />
                    </label>
                    <label>
                        ID Showroom:
                        <input
                            type="number"
                            name="showroomId"
                            value={formData.showroomId}
                            onChange={handleInputChange}
                        />
                    </label>
                    <button onClick={handleSubmit}>Trimite</button>
                    <button onClick={() => {
                        setShowAddForm(false);
                    }}>Anulează</button>
                </div>
            )}
        </div>
    );
}

export default CarManagement;
